import styled from "react-emotion";

export default styled("h2")`
  font-weight: 700;
  margin: 0;
  margin-bottom: 16px;
  padding-bottom: 12px;
  letter-spacing: 0.025em;
  text-transform: uppercase;
  line-height: 1.25;
  color: black;
  border-bottom: 2px solid #5978f3;
  font-size: 16px;
`;
